//import axios from 'axios';
import Swal from 'sweetalert';

function Preguntas() {

    function open(params) {
        Swal({
            title: 'Preguntas'
        })
    }

    return(
        <div>
            <button onClick={open}>New game</button>
        </div>
    )
};

export default Preguntas;
